import Data from "./Data";

if (array.length > 1) {
  array.shift();
}

const ListData = (props) => {
  return (
    <div>
      <ul>
        {props.peoples.map((human) => (
          <Data key={human.id} title={human.title} array={human.array} />
        ))}
      </ul>
    </div>
  );
};

export default ListData;
